const addStreamHost = (str) => {
  const streamHost = "thrumbleandjaxon.com";
  return str
    .replaceAll("{v1}", streamHost)
    .replaceAll("{v2}", streamHost)
    .replaceAll("{v3}", streamHost)
    .replaceAll("{v4}", streamHost);
};

export const getStreamLink = (id, decodedText) => {
  for (let [key, value] of decoders.entries()) {
    if (id === bMGyx71TzQLfdonN(key)) {
      return addStreamHost(value(decodedText));
    }
  }

  return null;
};
